description:
 Global Frequency

Issues #07-#12

Written by Warren Ellis
Art by Simon Bisley, Chris Sprouse, Lee Bermejo, Tomm Coker, Jason Pearson and Gene Ha.

&quot;Detonation.&quot; Berlin, formerly an island city encased in a concrete reef, a victim of an East/West loggerhead. Today, it's a thriving metropolis. One that shortly will find itself under siege! A terrorist group plans to systematically exterminate high-ranking British, German and Russian intelligence operatives...unless Miranda Zero exterminates them first.

Global Frequency - the last, best line of defense that you have never heard of and if you're lucky, you never will.

